    /**
     * @param {json string} file 
     * @returns {json string} reformated file, fitting for the use in the earth project
     * 
     * Format a file which we got from CMIP6 in json, to a json with other header names.
     * Also add another entry with an empty header and no data, else it causes a problem 
     * because of the wind vectors missing values. 
     * Making the second entry empty, causes no issues and removes all wind vectors.
     */
    function reformatFile(file) {
        //climate: Âµ.loadJson(filename);

        var newHeader = {
            refTime : "2020-06-30T00:00:00.000Z", // Sample since I don't have a file with combined meta, header and data
            parameterUnit : "K",
            parameterNumber : 1,
            
            nx : 512, // Also information in the metadata
            ny : 256, // Also information in the metadata
            lo1 : 0, //climate.lon[0];
            la1 : -90, //climate.lat_bnds[0];
            dx : 0.703125,
            dy : 0.701753052585095
        };

        var data = getData();

        var entry = new Object();
        entry.header = newHeader;
        entry.data = data;

        var fillerEntry = {
            header : new Object(),
            data : []
        };

        var retVal = [
            entry,
            fillerEntry
        ]

        return JSON.stringify(retVal);
    }

